import "./App.css";
import MenuAppBar from "./Components/MenuAppBar.js";

function App() {
  return (
    <div className="App">
        <MenuAppBar> </MenuAppBar>

        <nav>
            <ul>
                <li>
                    Add a medication
                </li>
                <li>
                    Your medications
                </li>
            </ul>
        </nav>
    </div>
  );
}

export default App;
